  false,\n\t\"url\": null,\n\t\"notes\": \"The Delta and Breton NWRs Habitat Management
  Plan provides a long-term vision and specific guidance on managing habitats for
  the resources of concern at Delta and Breton NWRs, to facilitate continuity in management
  programs. Refuge background, resources of concern, and habitat management goals
  and objectives are discussed. Management strategies and prescriptions then identify
  how and the specific means by which management and monitoring strategies will be
  implemented. Appendices follow.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
